import styled from 'styled-components';

export const LogoContainerStyled = styled.div`
  display: flex;
  position: relative;
  align-items: center;
  justify-content: center;
  height: 200px;
  width: 200px;
  margin-right: 0 auto;
  z-index:30;

`;
